import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import Home from './components/Home.jsx';
import Event from './components/Eventlist.js';
import Book from './components/Booking.jsx';
import Register from './components/Register.js';
import Contact from './components/Contact.jsx';
import Log from './components/Login.js';
import EventList from './components/Eventlist.js';
import AdminAddEvent from './components/AdminAddEvent';
import './App.css';
const isAdmin = true; 
function App() {
  return (
    <Router>
      <div>
       <div className="navibar">
          <Link className="home" to="/">HOME</Link>
          <Link className="event" to="/events">PRODUCT LIST</Link>
          <Link className="booking" to="/booking">ORDER</Link>
          <Link className="contact" to="/contact">CONTACT</Link>
          {isAdmin && <Link className="admin" to="/admin">LOCATION</Link>}
        </div>
        {/* <Home/>
        <EventList/>
        <Signup/>
        <Book/>
        <AdminAddEvent/> */}


        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />

            <Route path="/events" element={<EventList />} />
            <Route path='/signup' element={<Register/>}/>

            <Route path="/booking" element={<Book />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/login" element={<Log />} />
            {isAdmin ? (
              <Route path="/admin" element={<AdminAddEvent />} />
            ) : (
              <Route path="*" element={<Navigate to="/events" />} />
            )}

          </Routes>

        </div>
        <div  className='homepage-content'>

        </div>
      </div>
    </Router>
  );
}

export default App;
